pragma solidity ^0.8.18;

contract TsoGithubRegistry {

  mapping(address => uint64[]) public tsoToGithubUserId; // mapper from tso's to github users

  constructor(){
    /**
      Empty constructor
     */
  }

  function setTsoGitlabUsers(uint64[] calldata userIds) external payable {
    // we cound requirte that the sender is whitelisted tso when we deploy
    tsoToGithubUserId[msg.sender] = userIds;
  }

  function getTsoGitlabUsers(address tso) external view returns (uint64[] memory){
    return tsoToGithubUserId[tso];
  }

}

